import { http, HttpResponse } from 'msw'

export const handlers = [

  http.post("/getCompatiblePlans", async ({ request }) => {

    const payload = await request.json();

    if(payload.searchType === 'IMEI') {
      return HttpResponse.json({
        plans: [
        { id: 1, name: 'Tom' },
        { id: 2, name: 'Jerry' },
        { id: 3, name: 'Spike' },
        ],
      })
    } else {

    }

  })
];
